import React from 'react'

function Error(props) {
    return (
        <div>
            <h1 className='headlineError'>Invalid input</h1>
            <p className='errorMessage'>{props.message}</p>
            <button className='errorButton'>Okay</button>
        </div>
    )
}

export default Error
